static __complex128 fft_zeta[N];
static __complex128 ifft_zeta[N];

static mpc_t fft_zeta_reduce_k[L][N];
static mpc_t ifft_zeta_reduce_k[L][N];

static uint64_t fft_initialised;

static void fft_init()
{
	uint64_t i, j;
	mpfr_t re_high, im_high;
	__float128 re, im;
	
	if (!fft_initialised)
	{
		for (i = 0; i < N; i++)
		{
			re = strtoflt128(fft_zeta_str[i][0], NULL);
			im = strtoflt128(fft_zeta_str[i][1], NULL);
			
			fft_zeta[i] = re + im * I;
			ifft_zeta[i] = conjq(fft_zeta[i]);
		}
		
		mpfr_inits(re_high, im_high, NULL);

		for (j = 0; j < L; j++)
		{
			mpfr_set_prec(re_high, reduce_k_prec[j]);
			mpfr_set_prec(im_high, reduce_k_prec[j]);

			for (i = 0; i < N; i++)
			{
				mpc_init2(fft_zeta_reduce_k[j][i], reduce_k_prec[j]);
				mpc_init2(ifft_zeta_reduce_k[j][i], reduce_k_prec[j]);
				
				mpfr_set_str(re_high, fft_zeta_str[i][0], 10, MPFR_RNDN);
				mpfr_set_str(im_high, fft_zeta_str[i][1], 10, MPFR_RNDN);
				mpc_set_fr_fr(fft_zeta_reduce_k[j][i], re_high, im_high, MPC_RNDNN);
				mpc_conj(ifft_zeta_reduce_k[j][i], fft_zeta_reduce_k[j][i], MPC_RNDNN);
			}
		}
		
		mpfr_clears(re_high, im_high, NULL);
		
		fft_initialised = 1;
	}
}

/* Cooley-Tukey FFT */
void fft(POLY_FFT *a, const uint64_t n)
{
	uint64_t t = n;
	uint64_t m, i, j;
	uint64_t j1, j2;
	__complex128 x, u;
	
	fft_init();
	
	for (m = 1; m < n; m <<= 1)
	{
		t >>= 1;
		for (i = 0; i < m; i++)
		{
			j1 = (i * t) << 1;
			j2 = j1 + t - 1;
			
			for (j = j1; j <= j2; j++)
			{
				x = a->poly[j];
				u = a->poly[j + t] * fft_zeta[m + i];
				a->poly[j] = x + u;
				a->poly[j + t] = x - u;
			}
		}
	}
}

void fft_reduce_k(POLY_FFT_HIGH *a, const uint64_t n, const uint64_t l)
{
	uint64_t t = n;
	uint64_t m, i, j;
	uint64_t j1, j2;
	mpc_t x, u;
	
	fft_init();
		
	mpc_init2(x, reduce_k_prec[l]);
	mpc_init2(u, reduce_k_prec[l]);
	
	for (m = 1; m < n; m <<= 1)
	{
		t >>= 1;
		for (i = 0; i < m; i++)
		{
			j1 = (i * t) << 1;
			j2 = j1 + t - 1;
			
			for (j = j1; j <= j2; j++)
			{
				mpc_set(x, a->poly[j], MPC_RNDNN);		
				mpc_mul(u, a->poly[j + t], fft_zeta_reduce_k[l][m + i], MPC_RNDNN);
				mpc_add(a->poly[j], x, u, MPC_RNDNN);
				mpc_sub(a->poly[j + t], x, u, MPC_RNDNN);
			}
		}
	}

	mpc_clear(x);
	mpc_clear(u);
}

/* Gentleman-Sande IFFT */
void ifft(POLY_FFT *a, const uint64_t n)
{
	uint64_t t = 1;
	uint64_t m, i, j;
	uint64_t j1, j2;
	uint64_t h = n;
	__complex128 x, y;
	
	fft_init();
	
	for (m = n; m > 1; m >>= 1)
	{
		j1 = 0;
		h >>= 1;

		for (i = 0; i < h; i++)
		{
			j2 = j1 + t - 1;
			
			for (j = j1; j <= j2; j++)
			{
				x = a->poly[j] + a->poly[j + t];
				y = a->poly[j] - a->poly[j + t];
				a->poly[j] = x;
				a->poly[j + t] = y * ifft_zeta[h + i];
			}
			j1 += t << 1;
		}
		t <<= 1;
	}

	for (j = 0; j < n; j++)
	{
		a->poly[j] = a->poly[j] / n;
	}
}

void ifft_reduce_k(POLY_FFT_HIGH *a, const uint64_t n, const uint64_t l)
{
	uint64_t t = 1;
	uint64_t m, i, j;
	uint64_t j1, j2;
	uint64_t h = n;
	mpc_t x, y;
	
	fft_init();
	
	mpc_init2(x, reduce_k_prec[l]);
	mpc_init2(y, reduce_k_prec[l]);
	
	for (m = n; m > 1; m >>= 1)
	{
		j1 = 0;
		h >>= 1;

		for (i = 0; i < h; i++)
		{
			j2 = j1 + t - 1;
			
			for (j = j1; j <= j2; j++)
			{
				mpc_add(x, a->poly[j], a->poly[j + t], MPC_RNDNN);
				mpc_sub(y, a->poly[j], a->poly[j + t], MPC_RNDNN);		
				mpc_set(a->poly[j], x, MPC_RNDNN);
				mpc_mul(a->poly[j + t], y, ifft_zeta_reduce_k[l][h + i], MPC_RNDNN);
			}
			j1 += t << 1;
		}
		t <<= 1;
	}

	for (j = 0; j < n; j++)
	{
		mpc_div_ui(a->poly[j], a->poly[j], n, MPC_RNDNN);
	}

	mpc_clear(x);
	mpc_clear(y);
}

/* splitfft from Falcon */
void split_fft(POLY_FFT *f0, POLY_FFT *f1, const POLY_FFT *a, const uint64_t n)
{
	uint64_t i, j;
	
	fft_init();
	
	f0->poly[0] = crealq(a->poly[0]);
	f1->poly[0] = cimagq(a->poly[0]);
	
	for (i = 0; i < (n >> 1); i++)
	{
		j = i << 1;
		
		f0->poly[i] = (a->poly[j] + a->poly[j + 1]) / 2;
		f1->poly[i] = (a->poly[j] - a->poly[j + 1]) * ifft_zeta[(n >> 1) + i] / 2;
	}
}

/* splitfft when input is real */
void split_fft_r(POLY_R *f0, POLY_FFT *f1, const POLY_R *a, const uint64_t n)
{
	uint64_t i, j;
	
	fft_init();
	
	f0->poly[0] = a->poly[0];
	f1->poly[0] = 0;
	
	for (i = 0; i < (n >> 1); i++)
	{
		j = i << 1;
		
		f0->poly[i] = (a->poly[j] + a->poly[j + 1]) / 2;
		f1->poly[i] = (a->poly[j] - a->poly[j + 1]) * ifft_zeta[(n >> 1) + i] / 2;
	}
}

/* mergefft from Falcon */
void merge_fft(POLY_FFT *a, const POLY_FFT *f0, const POLY_FFT *f1, const uint64_t n)
{
	uint64_t i, j;
	
	fft_init();
	
	a->poly[0] = crealq(f0->poly[0]) + crealq(f1->poly[0]) * I;
	
	for (i = 0; i < (n >> 1); i++)
	{
		j = i << 1;
		
		a->poly[j + 1] = f1->poly[i] * fft_zeta[(n >> 1) + i];
		a->poly[j] = f0->poly[i] + a->poly[j + 1];
		a->poly[j + 1] = f0->poly[i] - a->poly[j + 1];
	}
}
